import React from "react";

const App = () => {
  return <div className="app-container">
    <table>
      <thead>
        <tr>
          <th>Tytuł</th>
          <th>Treść wiadomości</th>
          <th>Data dodania</th>
          <th>Action</th>
        </tr>
      </thead>
    </table>
  </div>;
};

export default App;
